//Clase ProductLinkedList: Recibe los productos de nuestra LinkedList de productos (product_array_list)

import React, {Component} from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import {ProductConsumerLinkedList} from "../ContextLinkedList";
import ReactProduct from "./ReactProduct";
import Title from "./Title";
import product_linked_list from "./ProductLinkedListDriver";

class ProductArrayList extends Component{
    render() {
        return(
            <div className="py">
                <div className="container">
                    <Title title="Products"/>
                    <React.Fragment>
                        <div className="row">
                            <ProductConsumerLinkedList>
                                {
                                    value =>{
                                        console.log(product_linked_list.size);
                                        return value.products.array.map(product =>{
                                                return <ReactProduct key={product.productName} product={product} />
                                            }
                                        )
                                    }
                                }
                            </ProductConsumerLinkedList>
                        </div>
                    </React.Fragment>
                </div>
            </div>
        );
    }

}

export default ProductArrayList;
